// GetContractBin is Subsidies Registry implementation bin code
// Has to be compiled with flag bin-runtime
// Built from sonic-sfc TBD (aebb18b257620a93047962c8b2d3a7daedcf15bc)
// Solc version: 0.8.27+commit.40a35a09.Linux.g++
//
// Solc was installed using https://github.com/fabelx/go-solc-select
//
//	go install -v github.com/fabelx/go-solc-select/cmd/gsolc-select@latest
//	go install -v github.com/fabelx/go-solc-select/cmd/solc@latest
//	gsolc-select install 0.8.27
//	gsolc-select use 0.8.27
//
// Commands to compile:
//
//	make    # to fetch all dependencies in the sonic-sfc repo
//	solc --base-path ./ --include-path node_modules --evm-version cancun --optimize --optimize-runs 200  --bin-runtime ./contracts/sfc/SubsidiesRegistry.sol
func GetContractBin() []byte {
	return hexutil.MustDecode("")
}

// ContractAddress is the Subsidies Registry address
var ContractAddress = common.HexToAddress("0x85c4Db3b6C4441835ed524b7b7AB5bD5536ef7a0")

// InitializeCalldata represents the call of the initialize() method
var InitializeCalldata = hexutil.MustDecode("0x8129fc1c")
